import seaborn as sns
import numpy as np
import matplotlib.pyplot as plt

df = sns.load_dataset("penguins")

df

df['species'].unique()

"""![image.png](data:image/png;base64,)"""

sns.pairplot(df, hue="species")
plt.savefig('pariplot_pinguinos.png')

"""#1 Limpieza del dataset"""

df.isnull().sum()

df['sex'].value_counts().idxmax()

for element in ['bill_length_mm','bill_depth_mm','flipper_length_mm','body_mass_g']:
  df[element] = df[element].fillna(df[element].mean())

df['sex'] = df['sex'].fillna(df['sex'].value_counts().idxmax())

df.info()

df.describe()

for element in ['bill_length_mm','bill_depth_mm','flipper_length_mm','body_mass_g']:
  print(df[element][(df[element] > df.describe()[element]["mean"] + 3 * df.describe()[element]["std"]) |
                   (df[element] < df.describe()[element]["mean"] - 3 * df.describe()[element]["std"])].sum())

"""<img src="https://upload.wikimedia.org/wikipedia/commons/thumb/0/08/South_Shetland-2016-Deception_Island%E2%80%93Chinstrap_penguin_(Pygoscelis_antarctica)_04.jpg/1200px-South_Shetland-2016-Deception_Island%E2%80%93Chinstrap_penguin_(Pygoscelis_antarctica)_04.jpg" border="5" alt="Chinstrap" width=100 align="right">

#2 Preprocesamiento

<img src="https://a0.anyrgb.com/pngimg/794/1956/penguin%D1%8B-%D0%B0%D1%80%D0%BA%D1%82%D0%B8%D0%BA%D0%B8-penguen-adelie-penguin-galapagos-penguin-african-penguin-chinstrap-penguin-gentoo-penguin-mammals-penguin-antarctica.png" border="5" alt="Adelie" width=100 align="left">
"""

from sklearn.preprocessing import OneHotEncoder, StandardScaler, LabelEncoder

encoder = LabelEncoder()

df['species_codificada'] = encoder.fit_transform(df['species'])

y = df.species_codificada

y = y.values

y.shape

ohe = OneHotEncoder(sparse_output=False)

ohe_island = ohe.fit_transform(df[['island']])
ohe_sex = ohe.fit_transform(df[['sex']])
ohe_island = ohe_island[:,:-1]
ohe_sex = ohe_sex[:,:-1]

scaler = StandardScaler()

scaler_model = scaler.fit_transform(df[['bill_length_mm','bill_depth_mm','flipper_length_mm','body_mass_g']])

scaler_model

X = np.hstack((ohe_island, scaler_model, ohe_sex))

X

"""#3 Modelo

<img src="https://images.fineartamerica.com/images-medium-large-5/gentoo-penguin-steve-allenscience-photo-library.jpg" border="5" alt="Gentoo" width=200 align="right">
"""

import keras
from keras.models import Sequential
from keras.layers import Dense,Input
from keras.utils import to_categorical
from sklearn.model_selection import train_test_split

X_train, X_test, y_train, y_test = train_test_split(X, y, test_size=0.2, random_state=10)

X_train.shape, y_train.shape

classifier = Sequential()
classifier.add(Input(shape=(X_train.shape[1],)))
classifier.add(Dense(5,activation='relu'))
classifier.add(Dense(3,activation='softmax'))

classifier.compile(optimizer = 'adam', loss = 'sparse_categorical_crossentropy',metrics=['accuracy'])

historial = classifier.fit(X_train, y_train, validation_split=0.2, epochs = 200, verbose = 0)

score = classifier.evaluate(X_test, y_test, verbose=0)
score

plt.plot(historial.epoch,historial.history['loss'], 'b',label="loss")
plt.plot(historial.epoch,historial.history['val_loss'], '*r',label="val_loss")
plt.title(u'SCC')
plt.xlabel(u'√©poca')
plt.ylabel(r'$Loss(\omega, b)$')
plt.legend(loc='upper right')
plt.ylim([np.min(historial.history['loss'])-0.1,np.max(historial.history['loss'])+0.1])
plt.grid(True)
plt.savefig('error_pinguinos.png')

prediccion = classifier.predict(X_test)

y_pred = np.argmax(prediccion, axis=1)

"""#4 Matriz de confusi√≥n"""

from sklearn.metrics         import confusion_matrix, ConfusionMatrixDisplay

con = confusion_matrix(y_test, y_pred)

disp = ConfusionMatrixDisplay( confusion_matrix = con,  display_labels = df['species'].unique()  ).plot()
plt.savefig('matriz_pinguinos.png')